import React, { useState } from 'react';
import axios from 'axios';

const CalculatorComponent = () => {
  const [num1, setNum1] = useState('');
  const [num2, setNum2] = useState('');
  const [operation, setOperation] = useState('');
  const [result, setResult] = useState('');
  const [error, setError] = useState('');

  const handleCalculate = async () => {
    if (!num1 || !num2 || !operation) {
      setError('Por favor, completa todos los campos.');
      return;
    }

    setError('');
    setResult('');

    try {
      const response = await axios.post('http://localhost:3000/api/operations/calculate', {
        num1: parseFloat(num1),
        num2: parseFloat(num2),
        operation,
      });

      setResult(response.data.result);
    } catch (err) {
      setError(err.response?.data?.error || 'Error al conectar con el servidor.');
    }
  };

  const handleNumberClick = (number) => {
    if (!operation) {
      setNum1((prev) => prev + number);
    } else {
      setNum2((prev) => prev + number);
    }
  };

  const handleOperationClick = (op) => {
    if (!num1) {
      setError('Ingresa el primer número antes de seleccionar una operación.');
      return;
    }
    setOperation(op);
  };

  const handleClear = () => {
    setNum1('');
    setNum2('');
    setOperation('');
    setResult('');
    setError('');
  };

  return (
    <div style={{ textAlign: 'center', maxWidth: '400px', margin: '0 auto', fontFamily: 'Arial, sans-serif' }}>
      <h1>Calculadora Distribuida</h1>
      <div
        style={{
          border: '1px solid #ccc',
          padding: '20px',
          borderRadius: '10px',
          boxShadow: '0 2px 5px rgba(0,0,0,0.1)',
          background: '#f9f9f9',
        }}
      >
        <div style={{ marginBottom: '10px', fontSize: '1.5rem', minHeight: '40px' }}>
          {result ? `Resultado: ${result}` : `${num1} ${operation} ${num2}`}
        </div>

        {error && <div style={{ color: 'red', marginBottom: '10px' }}>{error}</div>}

        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(4, 1fr)', gap: '10px', marginBottom: '10px' }}>
          {[1, 2, 3, 4, 5, 6, 7, 8, 9, 0].map((num) => (
            <button
              key={num}
              onClick={() => handleNumberClick(num.toString())}
              style={{
                padding: '10px',
                fontSize: '1.2rem',
                borderRadius: '5px',
                border: '1px solid #ddd',
                background: '#fff',
                cursor: 'pointer',
              }}
            >
              {num}
            </button>
          ))}
        </div>

        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(4, 1fr)', gap: '10px', marginBottom: '10px' }}>
          <button
            onClick={() => handleOperationClick('add')}
            style={{
              padding: '10px',
              fontSize: '1.2rem',
              borderRadius: '5px',
              border: '1px solid #ddd',
              background: '#d4edda',
              cursor: 'pointer',
            }}
          >
            +
          </button>
          <button
            onClick={() => handleOperationClick('subtract')}
            style={{
              padding: '10px',
              fontSize: '1.2rem',
              borderRadius: '5px',
              border: '1px solid #ddd',
              background: '#f8d7da',
              cursor: 'pointer',
            }}
          >
            -
          </button>
          <button
            onClick={() => handleOperationClick('multiply')}
            style={{
              padding: '10px',
              fontSize: '1.2rem',
              borderRadius: '5px',
              border: '1px solid #ddd',
              background: '#d1ecf1',
              cursor: 'pointer',
            }}
          >
            ×
          </button>
          <button
            onClick={() => handleOperationClick('divide')}
            style={{
              padding: '10px',
              fontSize: '1.2rem',
              borderRadius: '5px',
              border: '1px solid #ddd',
              background: '#fff3cd',
              cursor: 'pointer',
            }}
          >
            ÷
          </button>
        </div>

        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
          <button
            onClick={handleClear}
            style={{
              padding: '10px 20px',
              fontSize: '1rem',
              borderRadius: '5px',
              border: '1px solid #ddd',
              background: '#f0f0f0',
              cursor: 'pointer',
            }}
          >
            C
          </button>
          <button
            onClick={handleCalculate}
            style={{
              padding: '10px 20px',
              fontSize: '1rem',
              borderRadius: '5px',
              border: '1px solid #ddd',
              background: '#007bff',
              color: '#fff',
              cursor: 'pointer',
            }}
          >
            =
          </button>
        </div>
      </div>
    </div>
  );
};

export default CalculatorComponent;
